import React, { useState } from 'react'
import { GIT_URL } from '../config'

const ReactLevel2 = () => {
  const [query, setQuery] = useState('')
  const [items, setItems] = useState({})
  const [totalCount, setTotalCount] =useState(0)

  const httpRequest = () => {
    fetch(GIT_URL + query,
      { method: 'GET' })
      .then(function (response) {
        return response.json()
      })
      .catch(function () {
        console.log('error')
      })
      .then(function (json) {
        setItems(json.items)
        setTotalCount(json.total_count)
      })
  }

  return (
    <div className='jumbotron jumbotronHome mt-5'>
      <h1 className='display-3'>
        Github user search
      </h1>
      <p className='lead'>
        Create an input text in which as the user types in, launch a search against Github users and return a result
        list.
      </p>
      <input className="form-control" placeholder="Search" type="text"
             onChange={(e) => {
               setQuery(e.target.value)
             }}
      />
      <button type="button" className="btn bg-gradient-primary" onClick={httpRequest}>Search</button>
      <hr className='my-4'/>

      <div className="container">
        <div className="row">



          {totalCount > 0 && (
            <div className='cardSet'>
              {items.map(item => (
                <div key={item.id}
                     className="cardApartment m-5">
                  <img className='sizeImgCard' src={backgroundImage} alt="appartement"/>
                  <a to={'/details-appartement/' + item.id}>
                    <div className='card-body'>
                      <div className='d-flex'>
                        <p className='mr-2'>
                          {item.number}
                        </p>
                        -
                        <p className='ml-2'>
                          {item.name}
                        </p>
                      </div>
                      <p className='availabe'>
                        Dispo
                      </p>
                      <p className='prix'>
                    <span className='ml-2'>
                      par moi
                    </span>
                      </p>
                    </div>
                  </a>
                </div>
              ))}
            </div>
          )}
          {totalCount && (
            <h1>
              NIKTAMER
            </h1>
          )}

          </div>
        </div>
      </div>

  )
}

export default ReactLevel2
